  \"2015-04-28T15:03:48.539782\",\n\t\"name\": \"avian-influenza-surveillance-and-disease-contingency-plan-for-prime-hook-national-wildlife\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"With Avian Influenza, a nonclinical viral
  infection, becoming a growing concern for wild bird populations in North America
  and the United States, it has become crucial for Fish and Wildlife field personnel
  to be prepared to conduct early detection surveillance and understand its role in
  state, regional and national preparedness and response planning. This Disease Contingency
  Plan will briefly describe the Resources of Concern specific to Prime Hook National
  Wildlife Refuge, disease surveillance detection activities, highly pathogenic avian
  influenza assessment and monitoring, disease outbreak response, data recording conducted
  on the refuge, and identification of private poultry assets immediately adjacent
  to the refuge, with associated risks and economic consequences should a severe outbreak
  occur locally on refuge lands.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
